interface Props {
    route: any;
}

export default function GetStartedScreen({ route }: Props) {
    const [hasAcceptedTermsOfService, setHasAcceptedTermsOfService] = useState(false)
    const opacity = useRef(new Animated.Value(1));
    const translateY = useRef(new Animated.Value(0));
    const scrollViewRef = useRef<ScrollView>(null);

    const handleTermOfServicePress = () => {
        dispatchNavigate('TermOfService')
    };


    const toggleHasAcceptedTermsOfService = (value: boolean | ((prevState: boolean) => boolean)) => {
        setHasAcceptedTermsOfService(value)
        scrollViewRef.current?.scrollToEnd({ animated: true });
    }

    const handleStartClick = () => {
        if (hasAcceptedTermsOfService) {
            AsyncStorage.setItem('hasAcceptedTermsOfService', JSON.stringify(true))
            const routeName = isHandset ? 'Navigation' : 'DrawerRoot'

            dispatchNavigate(routeName)
        }
    }


    const initialise = async () => {

        const useNativeDriver = true;
        Animated.parallel([
            Animated.timing(translateY.current, {
                useNativeDriver,
                toValue: -heights,
                duration: 500,
            }),
            Animated.timing(opacity.current, {
                useNativeDriver,
                toValue: 0,
                duration: 500,
            }),
        ]).start(() => {
            handleStartClick();
        });
    };

    return (
        <ScreenLayout disableScroll>
            <ScrollView ref={scrollViewRef} style={{flex: 1}} contentContainerStyle={{flexGrow: 1}}>
            <Animated.View
                style={[
                    styles.main,
                    {
                        opacity: opacity.current,
                        transform: [{ translateY: translateY.current }],
                        paddingBottom: Platform.OS == 'ios' ? 100 : 0
                    },
                ]}
            >
                <View style={{ alignItems: 'center', justifyContent: 'center' }}>
                    <CyberBoxText />
                    <CyberBoxLogo />
                </View>
                <View style={styles.textContainer}>
                    <Text h2>{'\u2022'}{' '}A ‘sat’ is a tiny fraction of a Bitcoin</Text>
                    <Text h2>{'\u2022'}{' '}100M sats equal 1 Bitcoin</Text>
                    <Text h2>{'\u2022'}{' '}There will only ever be 21M Bitcoin</Text>
                </View>
                <GoodLuck />
                <View style={styles.checkBoxContainer}>
                    <CheckBox
                        boxType="square"
                        disabled={false}
                        tintColor={colors.pink.default}
                        tintColors={{ true: colors.pink.default, false: colors.white }}
                        onTintColor={colors.pink.default}
                        onFillColor={colors.primary}
                        onCheckColor={colors.white}
                        style={{ transform: [{ scaleX: Platform.OS == 'ios' ? 0.8 : 1.2 }, { scaleY: Platform.OS == 'ios' ? 0.8 : 1.2 }] }}
                        value={hasAcceptedTermsOfService}
                        onValueChange={(newValue) => toggleHasAcceptedTermsOfService(newValue)}
                    />
                    <View>
                        <Text h3>By checking this box, you  agree to the {' '}
                        </Text>
                        <TouchableOpacity onPress={handleTermOfServicePress}>
                            <GradientText style={styles.textStyle}>
                                Terms of Service and Privacy Policy
                            </GradientText>
                        </TouchableOpacity>

                    </View>
                </View>
                <GradientCard 
                    colors_={hasAcceptedTermsOfService ? ['#464D6854', '#FFF'] : ['#B6B6B6', '#FFFFFF']}
                    onPress={initialise}
                    disabled={!hasAcceptedTermsOfService}
                    style={[styles.gradient, { marginBottom: 100, opacity: hasAcceptedTermsOfService ? 1 : 0.5 }, !hasAcceptedTermsOfService ? { backgroundColor: 'transparent' } : {}]}>
                    <View style={styles.container4}>
                        {hasAcceptedTermsOfService ?
                            <Image source={Start}
                                resizeMode="contain" style={styles.start} />
                            :
                            <Image source={StartNotActive}
                                resizeMode="contain" style={styles.start} />
                        }
                    </View>
                </GradientCard>
            </Animated.View>
            </ScrollView>
        </ScreenLayout >
    )
}